String testStepType = context.getCurrentStep().config.type;

if (testStepType.equals("restrequest")) {
    def headers = new StringToStringMap()
    def transactionId = RandomStringUtils.random(13, false, true)

    def sessionId = testRunner.testCase.getTestStepByName("SessionAndTransaction_ids")
                       .getPropertyValue("Session_ID")

    headers.put("username", "Rest")
    headers.put("password", "Rest000")
    headers.put("applicationId", "CHARTERGATEWAY")
    headers.put("transactionId", transactionId)
    headers.put("sessionId", sessionId)
    headers.put("timeStamp", "1438671020480")

    testStep.testRequest.setRequestHeaders(headers)
}

String testStepType = testStepResult.testStep.config.type
if (!testStepType.equals("restrequest") && !testStepType.equals("jdbc")) {
    return
}

def build = System.getenv("BUILD_NUMBER")
def workspace = System.getenv("WORKSPACE")

// Sanitize names (important for folders)
def suiteName = testRunner.testCase.testSuite.name.replaceAll(/[\\\/:*?"<>|]/, "_")
def caseName = testRunner.testCase.name.replaceAll(/[\\\/:*?"<>|]/, "_")

def responsePath
if (workspace && build) {
    // Jenkins run
    responsePath = workspace + File.separator + build + File.separator + "api_responses" + File.separator + suiteName + File.separator + caseName
} else {
    // Local run
    def projectPath = testRunner.testCase.testSuite.project.path
    responsePath = new File(projectPath).parent + File.separator + "api_responses" + File.separator + suiteName + File.separator + caseName
}

new File(responsePath).mkdirs()

// Sanitize filename
def stepName = testStepResult.testStep.label.replaceAll(/[\\\/:*?"<>|]/, "_")

def fos = new FileOutputStream(responsePath + File.separator + stepName + '.txt', true)
def pw = new PrintWriter(fos)
testStepResult.writeTo(pw)

pw.close()
fos.close()

