con:configuration.scriptText:
import groovy.json.JsonSlurper

def response = context.expand( '${18. Product-Configuration - Validate&Save - Additional#Response#$[\'ImplProductConfigurationsResponse\'][\'implValidateMultiProductConfigurationsResponse\'][\'productConfigurations\']}' )

def Results = new JsonSlurper().parseText(response)

def len= Results.result.size()

log.info "lenght of array is .."+len

def i=0

def j=0

def Products

def Main_Comp_Dynamic_Properties

def dyn_len

while(i<len)
{
	if(Results[i].productConfiguration.displayableItems[1]==null)
	{
		 log.info "Misc Does Not have Base Products"
	
	}
	else
	{
	Products=Results[i].productConfiguration.displayableItems[1]
	log.info Products.name
	Main_Comp_Dynamic_Properties=Products.productSpecContainment.containedProduct.dynamicProperties
	log.info Main_Comp_Dynamic_Properties.result.size()
	dyn_len=Main_Comp_Dynamic_Properties.result.size()
	while (j<dyn_len)
	{
		
		log.info Main_Comp_Dynamic_Properties[j].value.stringValue
		
		if(Main_Comp_Dynamic_Properties[j].name.equals("ScreenGuidingFlow"))
		{
			if(Main_Comp_Dynamic_Properties[j].value.stringValue.equals("NegotiateProductConfigurationAdditional") )
			{
			log.info "Screen Guiding flow check passed.."
			assert(true)
			}
			else
			{
			log.info "in else........."
			log.info Main_Comp_Dynamic_Properties[j].value.stringValue
			assert(false)
			}
			
		}
		
		j++
	}
	
	}
	i++;
}

