  if( testStep instanceof com.eviware.soapui.model.testsuite.Assertable && !testStep.disabled && testStep.assertionStatus.toString() != "VALID" ) {
   failed = true
   testRunner.testCase.setPropertyValue("FailedStep",testStep.getName())
   break;
  }
 }
